import Vue from 'vue'
import App from './App.vue'
import vuetify from './plugins/vuetify'
import loadScript from 'vue-plugin-load-script';

Vue.use(loadScript);

Vue.config.productionTip = false

Vue.loadScript("https://unpkg.com/vis-network@9.0.4/standalone/umd/vis-network.min.js");
Vue.loadScript("https://unpkg.com/leaflet@1.6.0/dist/leaflet.js");
Vue.loadScript("https://unpkg.com/ionicons@5.5.2/dist/ionicons/ionicons.esm.js");
Vue.loadScript("https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY");
Vue.loadScript("https://maps.googleapis.com/maps/api/js?key=YOUR_API_KEY");


new Vue({
  vuetify,
  render: h => h(App)
}).$mount('#app')
